package com.example.weather.repository;import lombok.Getter;import lombok.Setter;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Table;@Entity@Table(name = "main")@Getter@Setterpublic class MainEntity extends BaseEntity {    @Column(name = "main_ref_Id")    public void setRefId(Long refId) {        super.setRefId(refId);    }    @Column    private double temp;    @Column    private double feels_like;    @Column    private double temp_min;    @Column    private double temp_max;    @Column    private int pressure;    @Column    private int humidity;}